import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import "./Direction.scss";
import WebService from "../../../services/WebService";
import styled from "styled-components";
import StartLocation from "./StartLocation.js";
import PlacePlanner from "./PlacePlanner.js";
import { here } from "../../../config/constants";
import AuthService from "../../../services/AuthService";
import { ACTIVE_TYPE } from "../../../config/constants";
import { withCommas } from "../../../helpers/lib";
import { ROUTE_NAME } from "../../../routes/main.routing";

const Wrapper = styled.section`
    padding: 1em;
`;

class Direction extends Component {
    static propTypes = {
        fetchOrders: PropTypes.func,
        orders: PropTypes.array
    };

    constructor(props) {
        super(props);
        this.platform = null;
        this.map = null;

        this.state = {
            app_id: here.app_id,
            app_code: props.app_code,
            center: {
                lat: props.lat,
                lng: props.lng
            },
            zoom: props.zoom,
            theme: props.theme,
            style: props.style
        };
    }

    componentWillMount = () => {
        // this.fetchOrders();
    };
    componentDidMount = () => {
        var platform = new window.H.service.Platform({
            app_id: "APP_ID_HERE",
            app_code: "APP_CODE_HERE"
        });
    };
    // fetchOrders = () => {
    //     WebService.getAllOrders(AuthService.getTokenUnsafe(), 1000, 0, {}).then(res => {
    //         const result = JSON.parse(res);
    //         if (result.status && result.status === ACTIVE_TYPE.TRUE) {
    //             this.props.fetchOrders(result.orders.reverse());
    //         }
    //     });
    // };
    onLocate = e => {
        e.preventDefault();
        const self = this;
        navigator.geolocation.getCurrentPosition(function(position) {
            self.setState({
                start: {
                    lat: position.coords.latitude,
                    lng: position.coords.longitude
                }
            });
        });
    };

    // User manually changing latitude or longitude
    onLocationChanged = e => {
        e.preventDefault();
        let state = this.state;
        state["start"][e.target.id] = e.target.value;
        this.setState(state);
    };
    generateTableRows = orders => {
        return orders
            .map((order, idx) => {
                console.log(order);
                return (
                    <tr key={idx}>
                        <td>{order.date}</td>
                        <td>{withCommas(order.total)} â‚«</td>
                        <td>{order.status}</td>
                        <td>
                            <Link to={ROUTE_NAME.ORDER_DETAIL + "/" + order.id}>Details</Link>
                        </td>
                    </tr>
                );
            })
            .reverse();
    };

    render = () => {
        return (
            <div>
                <div className="breadcumb_area bg-img" style={{ backgroundImage: "url(/img/bg-img/breadcumb.jpg)" }}>
                    <div className="container h-100">
                        <div className="row h-100 align-items-center">
                            <div className="col-12">
                                <div className="page-title text-center">
                                    <h2>Directions</h2>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {/* <!-- ##### Breadcumb Area End ##### --> */}

                {/* <!-- ##### Order Grid Area Start ##### --> */}
                <section className="shop_grid_area">
                    <div className="container">
                        <div className="row justify-content-center">
                            <div className="col-10">
                                <div className="regular-page-content-wrapper section-padding-80">
                                    <div className="regular-page-text App">
                                        <StartLocation
                                            lat={this.state.start.lat}
                                            lng={this.state.start.lng}
                                            key="MyLocator"
                                            onChange={this.onLocationChanged}
                                            onLocate={this.onLocate}
                                        />{" "}
                                        <Wrapper>
                                            <p>Search for nearby places.</p>
                                            {console.log(this.state)}
                                            <PlacePlanner
                                                app_id={this.state.here.app_id}
                                                app_code={this.state.here.app_code}
                                                lat={this.state.start.lat}
                                                lng={this.state.start.lng}
                                            />
                                        </Wrapper>
                                        {/* <h3>Order list</h3>
                                        <table className="table">
                                            <thead>
                                                <tr>
                                                    <th scope="col">Date</th>
                                                    <th scope="col">Total</th>
                                                    <th scope="col">Status</th>
                                                    <th scope="col" />
                                                </tr>
                                            </thead>
                                            <tbody>{this.generateTableRows(this.props.orders)}</tbody>
                                        </table> */}
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    };
}

export default Direction;
